// Import necessary components and libraries
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './Header';
import Home from './components/Home';
import People from './components/People';
import Biosensing from './components/Biosensing';
import EBeam from './components/EBeam';
import EnergyStorage from './components/EnergyStorage';

function App() {
  return (
    <Router>
        <Header />
        <div className="container">
          <Routes>
            <Route path="/" component={Home} />
            <Route path="/People" component={People} />
            <Route path="/Biosensing" component={Biosensing} />
            <Route path="/EBeam" component={EBeam} />
            <Route path="/EnergyStorage" component={EnergyStorage} />
          </Routes>

        </div>
    </Router>
  );
}

export default App;
